import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

export default function QuizResultado() {
  const { userId } = useParams();
  const [resultado, setResultado] = useState(null);

  useEffect(() => {
    const fetchResultado = async () => {
      try {
        const res = await fetch(`http://localhost:3000/quiz/${userId}`);
        if (!res.ok) throw new Error("Erro ao buscar resultado");
        const data = await res.json();
        setResultado(data.resultado);
      } catch (err) {
        console.error(err);
      }
    };
    fetchResultado();
  }, [userId]);

  if (!resultado) return <p>Carregando resultado...</p>;

  return (
    <div>
      <h2>Seu Resultado do Quiz</h2>
      <pre>{JSON.stringify(resultado, null, 2)}</pre>
    </div>
  );
}
